import React, { Component } from 'react';
import B from '../assets/imgs/bg.jpg'
class Home extends Component {
    render() {
        return (
            <div style={{backgroundImage: `url(${B})`,flex:1,height:'100%',backgroundPosition: 'center',
                backgroundSize: 'cover',}}>
                <h2 style={{color:'white'}}>Gate Of Egypt</h2>

            </div>
        );
    }
}

export default Home;
